    <div className='WalluBackground'>
      <ScrollTest/>
      <AppDownloadView/>
      {wolluItemBottomSheet}
      <MainView/>
      {getSalaryView}
      {getWolluView}
      {showWolluAmountView}
      <WolluAppAggroView/>
      <div id="WolluAdSpace"/>
      <Slider/>
      <WolluAggroCardSlider/>
      <div className="GoogleAd">
        광고 
      </div> 
    </div>
    */
  );
}

export default Wollu;
